INSERT INTO `city_description` VALUES (1,'de',NULL,'Zagreb'),(1,'en',NULL,'Zagreb'),(1,'hr',NULL,'Zagreb'),(1,'it',NULL,'Zagabria'),(2,'de',NULL,'Ljubljana'),(2,'en',NULL,'Ljubljana'),(2,'hr',NULL,'Ljubljana'),(2,'it',NULL,'Lubiana'),(3,'de',NULL,'Belgrad'),(3,'en',NULL,'Belgrade'),(3,'hr',NULL,'Beograd'),(3,'it',NULL,'Belgrado'),(4,'de',NULL,'San Marino'),(4,'en',NULL,'San Marino'),(4,'hr',NULL,'San Marino'),(4,'it',NULL,'San Marino'),(5,'de',NULL,'Bratislava'),(5,'en',NULL,'Bratislava'),(5,'hr',NULL,'Bratislava'),(5,'it',NULL,'Bratislava'),(6,'de',NULL,'Vatikanstadt'),(6,'en',NULL,'Vatican City'),(6,'hr',NULL,'Vatikan'),(6,'it',NULL,'Citt del Vaticano'),(7,'de',NULL,'Stockholm'),(7,'en',NULL,'Stockholm'),(7,'hr',NULL,'Stockholm'),(7,'it',NULL,'Stoccolma'),(8,'de',NULL,'Madrid'),(8,'en',NULL,'Madrid'),(8,'hr',NULL,'Madrid'),(8,'it',NULL,'Madrid'),(9,'de',NULL,'London'),(9,'en',NULL,'London'),(9,'hr',NULL,'London'),(9,'it',NULL,'Londra'),(10,'de',NULL,'Bern'),(10,'en',NULL,'Bern'),(10,'hr',NULL,'Bern'),(10,'it',NULL,'Berna'),(11,'de',NULL,'Ankara'),(11,'en',NULL,'Ankara'),(11,'hr',NULL,'Ankara'),(11,'it',NULL,'Ankara'),(12,'de',NULL,'Kiew'),(12,'en',NULL,'Kiev'),(12,'hr',NULL,'Kijev'),(12,'it',NULL,'Kiev'),(13,'de',NULL,'Tirana'),(13,'en',NULL,'Tirana'),(13,'hr',NULL,'Tirana'),(13,'it',NULL,'Tirana'),(14,'de',NULL,'Andorra la Vella'),(14,'en',NULL,'Andorra la Vella'),(14,'hr',NULL,'Andorra la Vella'),(14,'it',NULL,'Andorra la Vella'),(15,'de','Wien ist eine alte Seele heit es. Aber eine, die mit der Leichtigkeit der Walzerstadt alte und neue Avantgarde inspiriert. Das Resultat: Eine Melange aus prchtiger Architektur und liebenswertem Charme. Schaut man vom Kahlenberg auf die Donau hinunter, kann man Wien mit allen Sinnen spren. Weinberge sind da zu sehen, dahinter glnzt das bauliche Erbe der mitteleuropischen Metropole. Kunstgeschichte sowieso. Wien hat ein intaktes historisches Stadtbild wie kaum eine andere Grostadt, geprgt von Prunkbauten aus der Barock- und Grnderzeit. Auf einer Fahrt ber die Wiener Ringstrae passiert man die Staatsoper, das Burgtheater, das Parlament, die Votivkirche, das Kunst- und Kulturhistorische Museum und das Rathaus. In der Weltstadt der Musik  ist mit den Wiener Philharmonikern eines der besten Orchester der Welt zuhause. Der \\\"Groe Saal\\\" des Wiener Musikvereins, auch \\\"Goldener Saal\\\" genannt, ist Wiens schnste Konzerthalle und gilt auch klangtechnisch als wahres Wunderwerk.','Wien'),(15,'en','Austrias capital offers a unique blend of imperial traditions and stunning modern architecture. It is famous for its cultural events, imperial sights, coffee houses, cozy wine taverns, and the very special Viennese charm. Viennas history dates back to the first post-Christian century when the Romans established the military camp Vindobona. Todays cityscape is characterised by the abundance of baroque buildings created mostly under the rule of Empress Maria Theresia and Emperor Franz Joseph who was largely responsible for the monumental architecture round the Ringstrae. Vienna owes much of its international fame to the many celebrated composer who lived and worked here including Strau, Mozart, Beethoven and Haydn. The Vienna Philharmonic Orchestra is one of the worlds best, the Staatsoper one of the worlds leading opera houses, the Vienna Boys Choir one the worlds most famous. In the last years Vienna has also established itself as a great musical metropolis.','Vienna'),(15,'hr','Zadivljujua kulturna ponuda, raskona arhitektura i ugodna atmosfera u kavanama i heurigerima objanjavaju zato je glavni grad Austrije omiljen u cijelom svijetu. Povijest Bea see sve do prvog stoljea poslije Krista, kada su Rimljani osnovali vojnu utvrdu Vindobonu. Dananju sliku grada obiljeio je prije svega barok, naroito za vrijeme vladavine carice Marije Terezije i cara Franje Josipa, koji je dao sagraditi luksuzni beki Ring ili Ringstrae. U Beu vas oekuju muzeji i umjetnike zbirke meunarodnog formata. Muzej povijesti umjetnosti s impresivnom zbirkom Bruegelovih slika, MuseumsQuartier i Muzej Leopold (s najveom zbirkom Schieleovih djela), Architekturzentrum, Kunsthalle i Albertina s najveom grafikom zbirkom na svijetu od preko 60.000 crtea. Be je u svijetu poznat i kao grad glazbe. Ovdje su djelovali mnogi slavni skladatelji, primjerice Strau, Mozart, Beethoven i Haydn. Beki filharmoniari ubrajaju se u sam svjetski vrh.','Be'),(15,'it','Citt imperiale, patria della Secessione e della psicanalisi, sede ONU e OPEC, offre ai suoi visitatori un ricco calendario d\\\'eventi, complessi museali, palazzi storici e giardini fioriti. Con il Prater, i molti caff, i locali di tendenza, e l\\\'isola del Danubio,  capace anche di far godere momenti di relax e di svago. L\\\'elenco delle attrattive della citt sarebbe lunghissimo, citiamo solo alcune tra i monumenti pi conosciuti: il palazzo di Schoenbrunn, residenza estiva degli Asburgo; il duomo di Santo Stefano e lHofburg, residenza invernale degli Ausburgo. Vienna  ricchissima anche di mostre e musei, quali: il Naturhistorisches Museum, il Kunsthistorisches Museum, il Museo di Arte Moderna, il Centro dellArchittetura, il Museo dellArte Barocca, il Museo della Scienza e delle Tecnica lAlbertina. Il MuseumsQuartierWien (MQW) situato in centro citt a fianco di rinomati musei,  con la sua area di 45.000 mq uno dei dieci complessi culturali pi grandi del mondo.','Vienna'),(16,'de',NULL,'Minsk'),(16,'en',NULL,'Minsk'),(16,'hr',NULL,'Minsk'),(16,'it',NULL,'Minsk'),(17,'de',NULL,'Brssel'),(17,'en',NULL,'Brussels'),(17,'hr',NULL,'Bruxelles'),(17,'it',NULL,'Bruxelles'),(18,'de',NULL,'Sarajevo'),(18,'en',NULL,'Sarajevo'),(18,'hr',NULL,'Sarajevo'),(18,'it',NULL,'Sarajevo'),(19,'de','Sofia ist die Hauptstadt von Bulgarien mit rund 1,2 Millionen Einwohnern. Vor mehr als 2000 Jahren war die Stadt eine thrakische Siedlung. An einer greren Bedeutung gewann sie innerhalb des Rmischen Reiches und hie Serdica. In den nchsten Jahren ndert Sofia Vlker und Reiche: Byzantinisches, Ungarisches, Osmanisches und Russisches Reich bis zur Unabhngigkeit im Jahr 1908. Zu dieser Stadt war auch das 20. Jahrhundert nicht sehr freundlich: Balkankriege, Erster und Zweiter Weltkrieg, in dem die Bombardierung der Stadt zu ihrer teilweisen Zerstrung fhrte. Trotz dunkler Vergangenheit, Sofia hat eine helle Perspektive. Der ffentliche Verkehr ist breit und effektiv. Man bemht sich um die Erhaltung der Geschichte und Architektur der Stadt. Regelmig werden neue Restaurants, Bars, Cafs geffnet, die der bereits dynamischen Stadt zum neuen Leben bringen. In Sofia gibt es viele Grten und Grnflchen, die Ideal fr Erholung sind. Die Stadt liegt am Fu des massiven Berges Vitosha, die 2290 Meter hoch ist. Vitosha ist im Winter eine Destination fr Skilaufer und Snowboarder, und im Sommer kann man wunderbare und zahlreiche Spaziergnge genieen.','Sofia'),(19,'en','Sofia is Bulgarias capital city and is home to 1.2 million people. Sofia was once a Thracian settlement over 2,000 years ago and was formerly Serdica, one of the most important cities in the Roman empire. Since, Sofias been passed between nations and empires: Byzantine, Magyar, Ottoman, Russian, until Bulgaria achieved full, complete independence in 1908. The 20th century was not kind to Sofia either: The Balkan Wars, World War I and World War II in which the city of Sofia was heavily bombed. But despite dark spots in Bulgarias past, Sofia has a bright outlook. Public transportation is extensive and efficient. Efforts are being made to preserve important markers of the citys history and architecture. Countless new restaurants, bars, and cafs are opening regularly, breathing new life into an already dynamic city. Sofia is full of gardens and green spaces which are host to picnics and late-night beers in summer and blanketed with snow in the winter. The city is nestled at the foot of the massive Vitosha Mountain, which at 2,290 meters is one of the largest mountains in close proximity to a European capital city. Vitosha is home to skiing and snowboarding in winter and astounding hikes in the summer.','Sofia'),(19,'hr','Sofija je glavni grad Bugarske s oko 1,2 milijuna stanovnika. Sofija je bila traansko naselje prije vie od 2000 godina, a na veoj vanosti je pridobila u sastavu Rimskog carstva kada se zvala Serdica. Narednih godina Sofija je mijenjala narode i carstva: Bizantsko, Maarsko, Osmansko te Rusko carstvo sve do neovisnosti 1908. godine. Ni 20. stoljee nije bilo ljubazno prema ovom gradu: Balkanski ratovi, Prvi sjvetski rat i Drugi svjetski rat u kojem je grad teko stradao od bombardiranja. Unato tamnoj povijesti, Sofija ima svjetlu perspektivu. Javni prijevoz je opsean i uinkovit, ulau se napori za ouvanje vanih obiljeja gradske povijesti i arhitekture te se redovito otvaraju mnogobrojni novi restorani, barovi i kafii, udahnjujui novi ivot u ve dinamian grad. Sofija je puna vrtova i zelenih povrina idelnih za odmor. Grad je smjeten u podnoju masivne planine Vitosha, visoke 2290 metara. Vitosha je dom skijanja i bordanja zimi, a ljeti prepuna zapanjujuih etnica.','Sofija'),(19,'it','Sofia  la capitale della Bulgaria con circa 1,2 milioni di abitanti. Pi di 2000 anni fa Sofia fu un insediamento dei Traci. Ha acquisito pi importanza nella composizione dell\'Impero Romano, quando fu chiamata Serdica. Durante i prossimi anni Sofia cambi nazioni e imperi: lImpero bizantino, ungherese, ottomano e russo, fino alla indipendenza nellanno 1908. Neanche il 20 secolo fu gentile con questa citt: le guerre balcaniche, la Prima guerra mondiale e la Seconda guerra mondiale in cui la citt fu pesantemente danneggiata dai bombardamenti. Nonostante la storia oscura, Sofia ha una prospettiva brillante. Il trasporto pubblico  ampio ed efficiente. Vengono compiuti sforzi per preservare le caratteristiche importanti della storia della citt e l\'architettura. Nuovi e numerosi ristoranti, bar e caff vengono regolarmente aperti, ispirando nuova vita in una citt gi dinamica.  Sofia  piena di giardini e aree verdi ideali per rilassarsi. La citt  situata ai piedi della massiccia montagna di Vitosha, alta 2290 metri. Vitosha  la destinazione per lo sci e lo snowboard in inverno, e in estate  piena di passeggiate meravigliose. ','Sofia'),(20,'de','Prag, die Stadt der hundert Trme, UNESCO-Denkmal und eine der schnsten Stdte der Welt. Das Altstdter Rathaus mit der berhmten Prager astronomischen Uhr. Krumme Gassen des jdischen Viertels, die Sie aus den Bchern von Franz Kafka kennen, durchdrungen von der uralten Legende vom Golem. Cafs, die zum Beisammensein einladen, Boutiquen, Schifffahrten auf der Moldau. Die gotische Karlsbrcke und die St.-Nikolaus-Kirche auf der Kleinseite, die schnste Barockkirche Prags. Palastgrten  weit entfernt vom Stadtgetmmel, der Hgel Petn mit dem Aussichtsturm, der an den Eiffelturm erinnert, und die Prager Burg  Jedes der Prager Stadtviertel hat seine einzigartige Atmosphre und seinen individuellen Zauber. Prag stellt sich Ihnen als bunte Stadt vor, die gern ihren Stil wechselt: Prag ist romantisch und geschftig, altertmlich und modern - aber vor allem ist es eine Weltstadt, die sich freut, Touristen aus der ganzen Welt zu empfangen. Es ist an der Zeit sich kennen zu lernen!','Prag'),(20,'en','Prague, City of a Hundred Spires, a UNESCO monument and one of the most beautiful cities in the world. The Old Town Hall with the famous Prague Astronomical Clock. The winding lanes of the Jewish Quarter, which you know from the novels of Franz Kafka, steeped in the legend of the Golem. Cafes enticing you to come and have a seat, boutiques and sight-seeing cruises on the Vltava. The Gothic Charles Bridge and Church of St. Nicholas in the Lesser Town, the most beautiful Baroque church in Prague. The Palace Gardens set away from the bustle of the city, Petn with a lookout tower reminiscent of a small Eiffel Tower and Prague Castle  Each of Pragues districts has its own characteristic atmosphere and unique charm. Prague presents itself to you as a changeable city, which likes to alternate styles: it is romantic and successful, ancient and modern, but above all it is a city that is cosmopolitan through and through, and is used to welcoming foreigners. It is time to get acquainted.','Prague'),(20,'hr','Prag, grad od stotinu zavoja, spomnenik UNESCO-a i jedan od najljepih gradova na svijetu. Stara gradska vijenica s poznatim prakim astronomskim satom. Krivudave staze idovske etvrti, koje poznajete iz romana Franza Kafke, proarane legendom o Golemu. Pregrt kafia, butika i vidikovca uz Vltavu. Gotiki Karlov most te crkva Sv. Nikole u Malom Gradu, koja je ujedno i najljepa barokna crkva u gradu. Vrtovi Palaa udaljenih od vreve grada, Petn vidikovac koji podsjea na mali Eiffelov toranj te Pariki Dvorac Svaka parika etvrt ima svoju karakteristinu atmosferu i jedinstveni arm. Prag se predstavlja kao promijenjiv grad koji voli alternativne stilove: romantian je i uspjean, drevan i moderan, ali povrh svega grad koji je kozmopolitanski te pristupaan za sve turiste. Vrijeme da se upoznamo.','Prag'),(20,'it','Praga, citt delle cento torri, patrimonio dellUNESCO, una delle citt pi belle del mondo. Il Municipio della Citt Vecchia con il celebre Orologio astronomico di Praga, le viuzze tortuose del quartiere ebraico rese note dai romanzi di Franz Kafka e intrise di leggende sul Golem, le caffetterie che invitano ad entrare e sedersi, le boutique e le escursioni in battello sul fiume Moldava, il Ponte Carlo in stile gotico e la chiesa di San Nicola nel Quartiere Piccolo, la pi bella chiesa barocca di Praga, i Giardini del Castello lontani dal trambusto cittadino, la collina di Petn con la sua torre panoramica che sembra una Torre Eiffel in miniatura, il Castello di Praga. Ogni quartiere di Praga ha la sua atmosfera peculiare e un fascino unico. Praga si presenta come una citt mutevole, a cui piace alternare gli stili, sa essere romantica, frenetica, antica e moderna, ma soprattutto  una citt cosmopolita abituata ad accogliere stranieri.  arrivato il momento di conoscerla!','Praga'),(21,'de',NULL,'Kopenhagen'),(21,'en',NULL,'Copenhagen'),(21,'hr',NULL,'Kopenhagen'),(21,'it',NULL,'Copenaghen'),(22,'de',NULL,'Helsinki'),(22,'en',NULL,'Helsinki'),(22,'hr',NULL,'Helsinki'),(22,'it',NULL,'Helsinki'),(23,'de',NULL,'Paris'),(23,'en',NULL,'Paris'),(23,'hr',NULL,'Pariz'),(23,'it',NULL,'Parigi'),(24,'de',NULL,'Berlin'),(24,'en',NULL,'Berlin'),(24,'hr',NULL,'Berlin'),(24,'it',NULL,'Berlino'),(25,'de',NULL,'Athen'),(25,'en',NULL,'Athens'),(25,'hr',NULL,'Atena'),(25,'it',NULL,'Atene'),(26,'de','Budapest, oft beschrieben als \"Paris des Ostens, ist nicht nur nach Sehenswrdigkeiten einer mehrere Tausend Jahre langen Kultur bekannt, sondern auch nach Reliquien anderer Vlker, die hier lebten. In der Stadt sind berreste des Rmischen Reiches bzw. der viel lteren Osmanen zu finden. Nach dem Rmischen Reich kam es zum Bndnis mit sterreich, was viel Einfluss auf das gegenwrtige Aussehen und den Stil der Stadt hatte. Die Hauptstadt besteht aus zwei Teile, Buda und Pest, die von dem Fluss Donau getrennt werden und die ihren ganz eigenen Charakter in demselben Rahmen der Stadt haben. In dem vorstdtischen und historischen Teil des Budas kann man mittelalterliche Straen und Huser, Museen, Hhlen, sowie Ausgrabungssttte aus der Rmischen Zeit finden. Der dynamische Stadtteil Pest sticht mit dem hchsten Parlamentsgebude Europas hervor und ist auch nach zahlreichen Spaziergngen entlang des Flusses, Flohmrkten, Buchhandlungen, Antiquittengeschfte und Cafs bekannt ist. Budapest hat ihren Besuchern vieles zu bieten. In der Stadt gibt es zahlreiche Museen, Galerien, Kirchen, Synagogen, Schlsser und historische Gebuden, die die Sezession in groem Mae beeinflusste.','Budapest'),(26,'en','Often described as the \"Little Paris of Middle Europe\", Budapest is famous not only for the monuments reflecting its own 1,000-year-old culture, but also for the relics of others who settled here. Remains from both Roman occupation and much later ruled by the Turks can still be seen in the city. After the Ottoman Empire the union with Austria has a particular influence on the city\'s form and style. The capital has two sides, Buda and Pest, stretching along the banks of the Danube, representing two different characters of the city. Suburban Buda and its historic castle district offer medieval streets and houses, museums, caves and Roman ruins. The dynamic Pest side boasts the largest parliament building in Europe, riverside promenades, flea markets, bookstores, antique stores and caf houses. Budapest has a lot to offer. Museums and galleries, churches and synagogues, palaces and historic buildings, baths and pools are presented together with the influence of Secession in the city.','Budapest'),(26,'hr','esto opisivana kao mali Pariz Srednje Europe, Budimpeta nije poznata samo po spomenicima tisuljetne kulture, ve i po relikvijama drugih naroda koji su ovdje obitavali. U gradu su prisutni ostaci iz perioda Rimskog Carstva, kao i znatno starijeg prisustva Turaka. Nakon Osmanskog Carstva dolo je do saveza s Austrijom, to je znatno utjecalo na dananji izgled i stil grada. Glavni grad se sastoji od dva dijela, Budima i Pete, koji se pruaju du obale Dunava s dva potpuno zasebna karaktera u okviru istog grada. U prigradskom i povijesnom dijelu Budima moemo nai srednjovjekovne ulice i kue, muzeje, pilje te nalazita iz rimskog doba. Dinamina petanska strana se izdvaja s najveom zgradom parlamenta u Europi, etnicama uz rijeku, buvljacima, knjiarama, duanima antikviteta i kafiima. Budimpeta ima mnogo toga za ponuditi posjetiocima. U gradu s prepoznatljivim utjecajem secesije prisutni su mnogobrojni muzeji, galerije, crkve, sinagoge, dvorci te povijesne zgrade.','Budimpeta'),(26,'it','Spesso descritta come la piccola Parigi dellEuropa centrale, la citt di Budapest non  famosa solo per i monumenti di una cultura millenaria, ma anche per le reliquie di altri popoli che vivevano qui. Nella citt si trovano i resti dellImpero romano, come anche della pi vecchia presenza dei Turchi. Dopo lImpero ottomano lUngheria si unisce con lAustria. Questa alleanza ha influenzato in modo significativo l\'aspetto e lo stile della citt di oggi. La capitale dellUngheria  divisa in due parti, Buda e Pest, dal fiume Danubio. Le due parti di Budapest hanno diverse caratteristiche allinterno della stessa citt. Nella parte suburbana e storica di Buda possiamo trovare strade e case medievali, musei, grotte e siti di epoca romana. Pest  la parte pi dinamica e si distingue per il pi grande edificio del parlamento in Europa, la passeggiata lungo il fiume, bufali, librerie, negozi di antiquariato e caff.  Budapest ha molto da offrire ai visitatori. Nella citt si trovano numerosi musei, gallerie, chiese, sinagoghe, castelli ed edifici storici con un\'influenza riconoscibile della secessione.','Budapest'),(27,'de',NULL,'Dublin'),(27,'en',NULL,'Dublin'),(27,'hr',NULL,'Dublin'),(27,'it',NULL,'Dublino'),(28,'de','Das Resultat der 3000-jhrigen ad hoc urbanen Entwicklung ist der aufregende Anblick auf die Stadt und ihre Landschaft. Alte Ikonen wie Kolosseum, Rmisches Forum und Pantheon erinnern an das Goldene Zeitalter der Stadt, die als caput mundi (Welthauptstadt) bekannt war, whrend monumentale Basilika ber ihre Geschichte erzhlen, denn sie ist der Sitz der katholischen Kirche. ber den Vatikan hngt die Basilika Sankt Peter, die von dem Ehrgeiz der rmischen Ppste aus der Renaissance und der Genialitt ihrer Architekten zeugt. Durch die Geschichte spielte die Stadt eine groe Rolle in Umwlzungen der westlichen Kunst, groe Knstler anlockend, die folgend Grenzen der kreativen Leistungen bewegten. Rom ist reich an antiken Skulpturen, die die Weltklasse  Museen zieren. Byzantinische Mosaiken und Renaissance-Fresken glnzen in reich verzierten Kirchen und auf Barockfassaden auf mittelalterlichen Pltzen. Im Zentrum befinden sich Meisterwerke der europischen Knstler: Skulpturen von Michelangelo, Bilder von Caravaggio, Fresken von Raphael und Brunnen von Bernini.','Rom'),(28,'en','The result of 3000 years of ad hoc urban development, Rome\'s cityscape is an exhilarating sight. Ancient icons such as the Colosseum, Roman Forum and Pantheon recall the citys golden age as caput mundi (capital of the world), while monumental basilicas tell of its history as seat of the Catholic Church. Lording it over the skyline, St Peters Basilica towers over the Vatican, testifying to the ambition of Romes Renaissance popes and the genius of its game-changing architects. Throughout history, the city has starred in the great upheavals of Western art, drawing top artists and inspiring them to push the boundaries of creative achievement. Ancient statues adorn world-class museums, Byzantine mosaics and Renaissance frescoes dazzle in art-rich churches and baroque facades flank medieval piazzas. Stroll through the centre and without even trying youll come across masterpieces by the titans of European art: Michelangelo, Caravaggio, Raphael and Bernini.','Rome'),(28,'hr','Rezultat 3000 godina ad hoc urbanog razvoja, gradski pejza Rima je uzbudljiv prizor. Drevne ikone poput Koloseuma, Rimskog foruma i Panteona podsjeaju na zlatno doba grada kao caput mundi (glavni grad svijeta), dok monumentalne bazilike govore o njegovoj povijesti kao sjeditu Katolike crkve. Nad Vatikanom se nadvija bazilika sv. Petra koja svjedoei o ambicijama rimskih renesansnih papa i genijalnosti njegovih arhitekata. Kroz povijest grad je odigrao veliku ulogu u preokretima zapadne umjetnosti, privlaei vrhunske umjetnike i nadahnjujui ih da pomiu granice kreativnog postignua. Rim obiluje drevnim kipovima koji krase muzeje svjetske klase, bizantskim mozaicima i renesansnim freskama koje bljete u bogato ukraenim crkvama te baroknim proeljima na srednjovjekovnim trgovima. Proetate li se kroz centar, naii ete na remek-djela titana europske umjetnosti: skulpture Michelangela, slike Caravaggia, freske Raphaela te fontane Berninija.','Rim'),(28,'it','Il risultato dello ad hoc sviluppo urbano lungo 3000 anni  l\'emozionante spettacolo della citt e del suo paesaggio. Le icone antiche come il Colosseo, il Foro Romano e il Pantheon ci ricordano l\'et d\'oro della citt come caput mundi (la capitale del mondo). Le basiliche monumentali parlano della sua storia come la sede della Chiesa cattolica. Sopra il Vaticano c\' la basilica di San Pietro, testimone delle ambizioni dei papi del Rinascimento romano e dell\'ingegno dei suoi architetti. Nel corso della storia, la citt ha svolto un ruolo importante nelle inversioni dell\'arte occidentale, attirando i migliori artisti e ispirandoli a spostare i limiti della realizzazione creativa. A Roma si trovano tante sculture antiche che scintillano musei di fama mondiale. Mosaici bizantini e affreschi rinascimentali brillano nelle chiese riccamente decorate e sulle facciate barocche in piazze medievali. Nel centro si possono vedere i capolavori dell\'arte europea: le sculture di Michelangelo, i dipinti di Caravaggio, gli affreschi di Raffaello e le fontane del Bernini.','Roma'),(29,'de',NULL,'Pristina'),(29,'en',NULL,'Pristina'),(29,'hr',NULL,'Pritina'),(29,'it',NULL,'Pristina'),(30,'de',NULL,'Riga'),(30,'en',NULL,'Riga'),(30,'hr',NULL,'Riga'),(30,'it',NULL,'Riga'),(31,'de',NULL,'Vaduz'),(31,'en',NULL,'Vaduz'),(31,'hr',NULL,'Vaduz'),(31,'it',NULL,'Vaduz'),(32,'de',NULL,'Luxemburg'),(32,'en',NULL,'Luxembourg'),(32,'hr',NULL,'Luxembourg'),(32,'it',NULL,'Lussemburgo'),(33,'de',NULL,'Skopje'),(33,'en',NULL,'Skopje'),(33,'hr',NULL,'Skoplje'),(33,'it',NULL,'Skopje'),(34,'de',NULL,'Kischinau'),(34,'en',NULL,'Chisinau'),(34,'hr',NULL,'Kinjev'),(34,'it',NULL,'Chiinu'),(35,'de',NULL,'Monaco'),(35,'en',NULL,'Monaco'),(35,'hr',NULL,'Monaco'),(35,'it',NULL,'Monaco'),(36,'de',NULL,'Podgorica'),(36,'en',NULL,'Podgorica'),(36,'hr',NULL,'Podgorica'),(36,'it',NULL,'Podgorica'),(37,'de','Amsterdam ist einzigartig unter den europischen Metropolen. Im Vergleich zu anderen Weltstdten ist Amsterdam recht klein, doch brgt es alle Vorteile einer Metropole  eine Vielzahl historischer Sehenswrdigkeiten, weltberhmte Museen und ein ausgeprgtes Nachtleben. Doch alles in berschaubar und im kleinen Rahmen. Amsterdam ist vielmehr als Grachten, Coffee-Shops und das Rot-Licht-Viertel. Die Stadt an sich hat ein internationales Flair und bietet etwas fr jeden Geschmack. Angefangen von Grachtenrundfahrten, Museumsbesuchen und Shoppingtrips bis zu den verschiedensten Formen von Unterhaltung und Ausgehen am Abend. Nichts ist weit voneinander entfernt und alles ist gut durch den ffentlichen Verkehr zu erreichen.','Amsterdam'),(37,'en','Amsterdam is one of the greatest small cities in the world. From Amsterdam canals to world-famous Amsterdam museums and historical Amsterdam sights, it is one of the most romantic and beautiful cities in Europe. Canal cruises are a popular way to see the city from the perspective of its canals.Amsterdam is also a city of tolerance and diversity. It has all the advantages of a big city: rich culture, lively Amsterdam nightlife, international restaurants, good transport - but is quiet, and largely thanks to its extensive canals, has a little road traffic. In this city your destination is never far away, but get a bike for an authentic local experience. And if you are staying for longer, consider a daytrip from Amsterdam to see also the surrounding towns and villages. They are full of attractions. To know more about Amsterdam you can read some basic facts and info.','Amsterdam'),(37,'hr','Amsterdam je jedan od najljepih gradova na svijetu. Od svojih kanala do svjetski poznatih muzeja i povijesnih znamenitosti, jedan je od najromantinijih i najljepih europskih gradova. To je takoer mjesto tolerancije i raznolikosti. Ima sve prednosti velikog grada: kulturu, zabavu, raznolike restorane, dobar prijevoz, ali je relativno miran, tih i sa vrlo malo cestovnog prometa. Nikada niste daleko od svog odredita u Amsterdamu. Glavne turistike atrakcije su muzeji. Sigurno ste uli za Rijksmuseum, Muzej Stedelijk ili Muzej Van Gogh, ali to je samo kap u malom moru od pedeset muzeja Amsterdama koji svake godine privlai milijune turista. Mnogo je malenih iznenaenja u gradu, ali nesumnjivo svi znate o idovskoj djevojci Ani Frank, ija se kua nalazi u glavnom gradu Nizozemske. Ako imate priliku, proetajte gradom i vidite uske nizinske kue i plutajue domove stanovnika.','Amsterdam'),(37,'it','Definita la Venezia del Nord per il suo sistema di canali,  una delle mete turistiche pi gettonate. Capitale del divertimento e del proibito, famosa per i suoi coffeeshop e la frenetica vita notturna, Amsterdam  rinomata anche per le molteplici attivit culturali, le architetture antiche e moderne, e i suoi musei (Van Gogh Museum, Rijksmuseum, Casa di Anna Frank, solo per citarne alcuni). Amsterdam Info vuol essere una guida turistica semplice e completa alla scoperta di questa piccola ma vivace citt, che offre davvero mille cose da fare! Questo sito  stato concepito per le esigenze dei turisti italiani in partenza verso la citt olandese pi famosa: dalle informazioni pratiche ai mezzi di trasporto, dalla prenotazione del luogo dove pernottare alle particolarit che Amsterdam sa offrire. Quindi buona visita al nostro sito, i tesori di Amsterdam non saranno pi un segreto per voi!','Amsterdam'),(38,'de',NULL,'Oslo'),(38,'en',NULL,'Oslo'),(38,'hr',NULL,'Oslo'),(38,'it',NULL,'Oslo'),(39,'de',NULL,'Warschau'),(39,'en',NULL,'Warsaw'),(39,'hr',NULL,'Varava'),(39,'it',NULL,'Varsavia'),(40,'de',NULL,'Lissabon'),(40,'en',NULL,'Lisbon'),(40,'hr',NULL,'Lisabon'),(40,'it',NULL,'Lisbona'),(41,'de',NULL,'Bukarest'),(41,'en',NULL,'Bucharest'),(41,'hr',NULL,'Bukuret'),(41,'it',NULL,'Bucarest'),(42,'de',NULL,'Moskau'),(42,'en',NULL,'Moscow'),(42,'hr',NULL,'Moskva'),(42,'it',NULL,'Mosca'),(43,'de',NULL,'Tallinn'),(43,'en',NULL,'Tallinn'),(43,'hr',NULL,'Tallinn'),(43,'it',NULL,'Tallinn'),(44,'de',NULL,'Vilnius'),(44,'en',NULL,'Vilnius'),(44,'hr',NULL